import React, { useState, useEffect } from 'react';

function Result() {
    const [ result, getResult ] = useState(null);
    useEffect(() => {
        fetch("http://localhost:8000/main")
            .then((res) => {
                console.log(res);
                return res.json();
            })
            .then(data => {
                getResult(data);
            });
        }, 
    []);
    return (
        <div className='result__container'>
            {result}
        </div>
    );
}

export default Result;
